import axios from "axios";

function isAuth(){
  let data;
  axios({
    method: 'get',
    withCredentials: true,
    url: 'http://localhost:5000/user/auth',
  }).then(res =>
    data = res.data
  )
  return data
}
function auth(){

  return isAuth()

}

export default auth;
